  SWIG_InstallConstants(d,swig_const_table);
  
  SWIG_Python_SetConstant(d, "PADDING_DISABLE",SWIG_From_int(static_cast< int >(PADDING_DISABLE)));
  SWIG_Python_SetConstant(d, "PADDING_ROUND_2",SWIG_From_int(static_cast< int >(PADDING_ROUND_2)));
  SWIG_Python_SetConstant(d, "PADDING_ROUND_4",SWIG_From_int(static_cast< int >(PADDING_ROUND_4)));
  SWIG_Python_SetConstant(d, "PADDING_ROUND_8",SWIG_From_int(static_cast< int >(PADDING_ROUND_8)));
