  SWIG_Python_SetConstant(d, "PADDING_SMALL_PRIME_FACTORS",SWIG_From_int(static_cast< int >(PADDING_SMALL_PRIME_FACTORS)));
  SWIG_Python_SetConstant(d, "INFINITE_NONE",SWIG_From_int(static_cast< int >(INFINITE_NONE)));
  SWIG_Python_SetConstant(d, "INFINITE_POS_X",SWIG_From_int(static_cast< int >(INFINITE_POS_X)));
  SWIG_Python_SetConstant(d, "INFINITE_NEG_X",SWIG_From_int(static_cast< int >(INFINITE_NEG_X)));
  SWIG_Python_SetConstant(d, "INFINITE_POS_Y",SWIG_From_int(static_cast< int >(INFINITE_POS_Y)));
  SWIG_Python_SetConstant(d, "INFINITE_NEG_Y",SWIG_From_int(static_cast< int >(INFINITE_NEG_Y)));
