  SWIG_Python_SetConstant(d, "OMF_FORMAT_BINARY_4",SWIG_From_int(static_cast< int >(OMF_FORMAT_BINARY_4)));
  SWIG_Python_SetConstant(d, "OMF_FORMAT_BINARY_8",SWIG_From_int(static_cast< int >(OMF_FORMAT_BINARY_8)));
  SWIG_Python_SetConstant(d, "HAVE_FFTW_THREADS",SWIG_From_int(static_cast< int >(1)));
